import React from 'react'
import '../styles/Footer.scss'
import CsvDownload from 'react-json-to-csv'


/**
* @author
* @function Footer
**/

const Footer = (props) => {
  return(
    <div id='Footer_wrapper'>
        <button >Download .csv</button> 
        <CsvDownload 
        id='btn_bg'
        data={props.data}
        filename='Sapporo.csv'

        />
    </div>
   )

 }

export default Footer
